import React, { Component } from "react";

export default class Connect extends Component {
  render() {
    return (
      <div className="section black-section">
        <div className="max-width">
          <p className="section-sub section-sub--centered">Get in touch</p>
          <h3 className="section-title section-title--centered">
            Let's connect
          </h3>
          <p className="description--centered">
            If you liked some of my ideas, and feel like talking to a young
            creative and motivated designer, shoot me an email!
          </p>
          <button>Say Hi!</button>
        </div>
      </div>
    );
  }
}
